using System;

namespace ConsoleApp29
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int baseNumber = 2;
            int multipleNumber = baseNumber;
            int degreeNumber = 1;
            int minimumNumber = 1;
            int maximumNumber = 100;
            int numberRandom = random.Next(minimumNumber, maximumNumber);

            while (baseNumber<=numberRandom)
            {
                baseNumber *= multipleNumber;
                degreeNumber++;
            }

            Console.WriteLine($"Полученное случайное число - {numberRandom} , оно меньше чем минимальная степень {multipleNumber} в степени {degreeNumber} или {baseNumber}");
        }
    }
}
