#include <stdio.h>
#include <Windows.h>
#include <AclAPI.h>
#include <locale.h>

int main() {
    // Открытие файла
    setlocale(LC_ALL, "Russian");
    printf("Открытие файла\n");
    HANDLE hFile = CreateFileW(L"test.txt", GENERIC_READ | GENERIC_WRITE, FILE_SHARE_READ, NULL, OPEN_EXISTING, FILE_ATTRIBUTE_NORMAL, NULL);
    if (hFile == INVALID_HANDLE_VALUE) {
        printf("Ошибка открытия файла\n");
        return 1;
    }

    // Получение информации о безопасности файла
    printf("Получение информации о безопасности\n");
    PSECURITY_DESCRIPTOR pSD = NULL;
    pSD = (PSECURITY_DESCRIPTOR)LocalAlloc(LPTR, SECURITY_DESCRIPTOR_MIN_LENGTH);
    DWORD dwRes = GetSecurityInfo(hFile, SE_FILE_OBJECT, DACL_SECURITY_INFORMATION, NULL, NULL, NULL, NULL, &pSD);
    if (dwRes != ERROR_SUCCESS) {
        printf("Ошибка получения информации о безопасности\n");
        CloseHandle(hFile);
        return 1;
    }

    // Добавление разрешений в ACL
    printf("Получение ACL\n");
    EXPLICIT_ACCESS ea;
    ZeroMemory(&ea, sizeof(EXPLICIT_ACCESS));
    ea.grfAccessPermissions = GENERIC_READ | GENERIC_WRITE;
    ea.grfAccessMode = SET_ACCESS;
    ea.grfInheritance = CONTAINER_INHERIT_ACE | OBJECT_INHERIT_ACE;
    ea.Trustee.TrusteeForm = TRUSTEE_IS_NAME;
    LPWSTR ptstrName = new WCHAR[256];
    wcscpy_s(ptstrName, 256, L"Everyone\0");
    ea.Trustee.ptstrName = ptstrName;
    printf("Добавление разрешений в ACL\n");
    PACL pOldDACL = NULL, pNewDACL = NULL;
    BOOL bOldDACLPresent = FALSE, bOldDACLDefaulted = FALSE;
    dwRes = GetSecurityDescriptorDacl(pSD, &bOldDACLPresent, &pOldDACL, &bOldDACLDefaulted);
    if (dwRes == ERROR_SUCCESS) {
        printf("Ошибка объявления разрешений в ACL\n");
    }

    // Установка нового ACL
    printf("Установка нового ACL\n");
    dwRes = SetSecurityInfo(hFile, SE_FILE_OBJECT, DACL_SECURITY_INFORMATION, NULL, NULL, pNewDACL, NULL);
    if (dwRes == ERROR_SUCCESS) {
        printf("Ошибка установки нового ACL\n");
        CloseHandle(hFile);
    }

    // Закрытие файла
    printf("Закрытие файла\n");
    return 0;
}

public class ThrowDemo
{
    static void throwone() throws IllegalAccessException
    {
        System.out.println("Inside throwone method");
        throw new IllegalAccessException("demo");
    }
    public static  void main(String[] args)
    {
        try {
            throwone();
        }
        catch (IllegalAccessException e)
        {
            System.out.println("Caught inside main");
            System.out.println(e);
        }
