import java.util.ArrayList;
import java.util.List;
import java.util.concurrent.CountDownLatch;
import java.util.concurrent.locks.ReentrantLock;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

public class Task10 {
    private static final Logger logger = LoggerFactory.getLogger("Task 10");
    private static final String[] strings = new String[]{
            "First", "Second", "Third", "Fourth", "Fifth", "Sixth", "Seventh", "Eighth", "Ninth", "Tenth"};
    private static List<String> checker;

    public static void main(String[] args) throws InterruptedException {
        for (int i = 0; i < 10000; i++) {
            launch(args);
        }
    }

    public static void launch(String[] args) throws InterruptedException {
        checker = new ArrayList<>(20);

        ReentrantLock l1 = new ReentrantLock();
        ReentrantLock l2 = new ReentrantLock();
        ReentrantLock lc = new ReentrantLock();
        ReentrantLock lc2 = new ReentrantLock();
        CountDownLatch countDownLatch = new CountDownLatch(2);
        Thread thread = new Thread(new StringPrinter(l1, l2, lc, lc2, countDownLatch));
        thread.start();
        new StringPrinter(l2, l1, lc, lc2, countDownLatch).run();
        thread.join();

        for(int i = 0; i + 1 < 20; i++) {
            if(checker.get(i).equals(checker.get(i + 1))) throw new RuntimeException();
        }
    }

    private record StringPrinter(ReentrantLock l1, ReentrantLock l2, ReentrantLock lc, ReentrantLock lc2, CountDownLatch countDownLatch)
            implements Runnable {

        @Override
        public void run() {
            try {
                l1.lock();
                countDownLatch.countDown();
                countDownLatch.await();
                for (String string : strings) {
                    lc.lock();      // (

                    logger.info(string);
                    checker.add(Thread.currentThread().getName());

                    l1.unlock();

                    lc2.lock();     // [

                    lc.unlock();    // )

                    l2.lock();
                    l1.lock();

                    lc2.unlock();   // ]

                    l2.unlock();
                }
                l1.unlock();
            } catch (InterruptedException e) {
                throw new RuntimeException(e);
            }
        }
    }
}

