            for (int i = 0; i < 1000000; i++)
            {
                if (local_max < v[i]){
                    local_max = v[i];
                }
            }

            #pragma omp critical
            {
                if (max_el < local_max){
                    max_el = local_max;
                }
            }
            
        }

        fn = omp_get_wtime();

        printf("Количество нитей: %d, Время: %f, Макс: %d\n", n, (fn-st), max_el);
    }
    
}

