#include <stdio.h>
#include <omp.h>
#include <iostream>

int main()
{
    double st, fn;


    int n = 1000000000;

    double pi = 0.0;

    st = omp_get_wtime();

    #pragma omp parallel num_threads(1) reduction(+: pi)
    {
        #pragma omp for
        for (int i = 0; i < n; i++){
            pi += 4 / ((1 + ( (i + 0.5) * (i + 0.5) / n / n))*n);
        }
    }

    fn = omp_get_wtime();

    printf("Количество нитей: 1, Время: %f, Pi: %.8f\n", (fn-st), pi);

    pi = 0.0;

    st = omp_get_wtime();

    #pragma omp parallel num_threads(8) reduction(+: pi)
    {
        #pragma omp for
        for (int i = 0; i < n; i++){
            pi += 4 / ((1 + ( (i + 0.5) * (i + 0.5) / n / n))*n);
        }
    }

    fn = omp_get_wtime();

    printf("Количество нитей: 8, Время: %f, Pi: %.8f\n", (fn-st), pi);
    
}

