#include <stdio.h>
#include <omp.h>
#include <iostream>

int main()
{
    double st, fn, t1;

    int n = 800;

    int m_1[n][n]; 
    int m_2[n][n];
    int res[n][n];

    for (int i = 0; i < n; i++){
        for (int j = 0; j < n; j++){
            m_1[i][j] = 2;
            m_2[i][j] = 3;
            res[i][j] = 0;
        }
    }

    for(int n = 1; n <= 10; n++){

        st = omp_get_wtime();

        for (int i = 0; i < 800; i++){
            for (int j = 0; j < 800; j++){
                res[i][j] = 0;
            }
        }

        #pragma omp parallel shared(m_1, m_2, res, t1) num_threads(n) 
        {

            #pragma omp for collapse(3)
            for (int i = 0; i < 800; i++){
                for (int j = 0; j < 800; j++){
                    for (int k = 0; k < 800; k++){
                        #pragma omp atomic
                        res[i][j] +=  m_1[i][k] * m_2[k][j];
                    }
                }
            }
            
        }

        fn = omp_get_wtime();

        if (n == 1){
            t1 = fn-st;
        }

        printf("Количество нитей: %d, Время: %f, Эффективность: %f\n", n, (fn-st), t1/(fn-st));

    }
    
    
}

